import Login from '../views/login/login'
import Home from '../views/home/home'
import User from '../views/user/user'
import Shop from '../views/shop/shop'

let routes = [
    {
        path: '/',
        name: '登录',
        exact: true,
        component: Login
    },
    {
        path: '/home',
        name: '首页',
        exact: true,
        component: Home
    },
    {
        path: '/user',
        name: '用户',
        component: User
    },
    {
        path: '/shop',
        name: '商店',
        component: Shop,


    },
]
export default routes;
